import React from 'react';
import { makeStyles, createMuiTheme, ThemeProvider } from '@material-ui/core/styles';
import Box from '@material-ui/core/Box';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';

import UploadButton from './uploadbutton';

const useStyles = makeStyles((theme) => ({
    box: {
        padding: theme.spacing(1),
        textAlign: 'center',
        color: theme.palette.text.secondary,
        whiteSpace: 'nowrap',
        margin: theme.spacing(2),
    },
    divider: {
        margin: theme.spacing(2, 0),
    },
    icon: {
        position: 'relative',
        top: '40%',
    }
}));



export default function Main() {
    const classes = useStyles();
    const theme = createMuiTheme({
        palette: {
            primary: {
                light: '#3b3b58',
                main: '#33334c',
                divider: '#515166',
            },
            secondary: {
                main: '#ffffff',
            },
        },
    });

    return (
        // <ThemeProvider theme={theme}>
            <Container fixed>
                <Grid container>
                    <Grid item xs={3} direction="column" justify="center" alignItems="stretch" >
                        <Box bgcolor="primary.light" className={classes.box} height={100}>logo</Box>
                        <Box bgcolor="primary.light" color='text.primary' className={classes.box} height={200}>
                           <UploadButton />
                        </Box>
                        <Box bgcolor="primary.light" className={classes.box} height={535}>file list</Box>
                    </Grid>
                    <Grid item xs={9} direction="column" justify="center" alignItems="stretch" >
                        <Box bgcolor="primary.light" className={classes.box} height={900}>result list</Box>
                    </Grid>
                </Grid>
            </Container>
        // </ThemeProvider>
    );
}
